import React from "react";
import Head_bar from "./dashboard/head_bar";
import Menu_bar from "./dashboard/menu_bar";

import Dashboard from "./dashboard/dashboard";

import '../styles/dashboard.css'

import SimpleBar from "simplebar-react";
import 'simplebar/dist/simplebar.min.css';

class Main extends React.Component {

    constructor(props) {
        super(props);
        console.log(this.props.User_data)
    }

    selectedPage() {
        switch (window.location.pathname) {
            case '/main/dashboard':
                return <SimpleBar forceVisible="x"><Dashboard/></SimpleBar>
            case '/main/lessons':
                return <Dashboard/>
        }
    }

    render() {
        return (
            <div className={'D_man_view'}>
                <Head_bar User_data={this.props.User_data}/>
                <div className={'D_work_view'}>
                    <Menu_bar/>
                    {
                        this.selectedPage()
                    }
                </div>
            </div>
        )
    }

}

export default Main;
